import React from 'react';

const DefaultInput = ({type, value, setValue, classOfContainer}) => {
  console.log(value)
  return (
    <div className={`${classOfContainer}`}>
      <input 
        type={type}
        value={value}
        onChange={(e) => setValue(e.target.value)}
        className="default-input"
    />

    </div>
  )
}

DefaultInput.defaultProps = {
  type:"text",
  classOfContainer:"",
  setValue:() => "",
  value:""
}

export {DefaultInput};
